const allowedSet = new Set(allowedPackages.map(pkg => pkg.toLowerCase()));
allowedPackages = null;

(function() {
  // Don't filtering packages with a release after this date (avoids filtering new packages):
  const cutoffDate = new Date('2025-02-28'); 


  const filterSearchResults = () => {
    const packageNameElements = document.querySelectorAll('a.package-snippet');
    if (packageNameElements.length > 0) {
      packageNameElements.forEach(packageElement => {
        const nameElement = packageElement.querySelector('span.package-snippet__name');
        const dateElement = packageElement.querySelector('time'); // Assumes date is in a <time> element

        if (nameElement && dateElement) {
          const packageName = nameElement.textContent.trim();
          const packageDate = new Date(dateElement.getAttribute('datetime')); // Parse the date

          // Check against allowed packages (case insensitive)
          //const isAllowed = allowedPackages.some(allowed => allowed.toLowerCase() === packageName.toLowerCase());
          const isAllowed = allowedSet.has(packageName.toLowerCase());

          if (!isAllowed && packageDate < cutoffDate) {
            const parent = packageElement.parentElement;

            // Hide the original element
            packageElement.style.display = 'none';

            // Create a placeholder with a link to show the package
            const placeholder = document.createElement('div');
            placeholder.style.margin = '10px 0';

            const packageNameText = document.createElement('span');
            packageNameText.textContent = packageName;
            packageNameText.style.fontWeight = 'bold';
            packageNameText.style.marginRight = '10px';

            const showLink = document.createElement('a');
            showLink.textContent = '(Hidden by PyPI Search Rez Filter browser plugin)';
            showLink.href = '#'; // Prevent navigation
            showLink.style.cursor = 'pointer';
            showLink.style.textDecoration = 'underline';
            showLink.style.color = 'blue';
            showLink.addEventListener('click', (event) => {
              event.preventDefault(); // Prevent default link behavior
              packageElement.style.display = 'block';
              placeholder.style.display = 'none';
            });

            placeholder.appendChild(packageNameText);
            placeholder.appendChild(showLink);
            parent.appendChild(placeholder);
          }
        }
      });
    } else {
      setTimeout(filterSearchResults, 500); // Retry after 0.5 seconds
    }
  };

  setTimeout(filterSearchResults, 100); // Initial delay of 0.1 seconds
})();
